INSERT INTO `instructions` (`id`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(1, 'General Instructions', 'general-instructions', '<p>1. Students will need to bring&nbsp;<strong>government-issued photo ID</strong>&nbsp;-- for example, a &nbsp; &nbsp; &nbsp;current passport, a BC driver&#39;s license, or a BC Services/Identity Card -- to &nbsp;show proof of identity.</p>\r\n\r\n<p>2. Students without government-issued photo ID will not be allowed to write the &nbsp;exam; they will need to register for another sitting.</p>\r\n\r\n<p>3. Photo ID might be held for the duration of the exam.</p>\r\n\r\n<p>4. Students should arrive 30-45 minutes before the start of the exam for &nbsp; &nbsp; &nbsp;registration check.</p>\r\n\r\n<p>5. Students will be required to leave all personal belongings -- including purses, &nbsp; backpacks, and cell phones -- at the side of the exam room.</p>\r\n\r\n<p>6. Once the exam starts, students should not leave the exam room until they &nbsp; &nbsp; &nbsp;have completed and handed in the exam.&nbsp;</p>\r\n', '2017-02-14 04:40:12', '2017-02-14 04:40:12'),
(2, 'Test Instructions', 'test-instructions', '<p>1. As you enter show your Student ID card.</p>\r\n\r\n<p>2.&nbsp;Make sure your mobile phone is switched off and place it at the front together with any bags, books, coats etc. Then find your seat.</p>\r\n\r\n<p>3.&nbsp;Remember that talking is not allowed at any time in the exam hall.</p>\r\n\r\n<p>4.&nbsp;Place your Student ID card on your desk next to your attendance card.</p>\r\n\r\n<p>5.&nbsp;Listen carefully to instructions. Students are required to comply with the instructions of invigilators at all times. For example, if you are asked to sit in a designated place then you must do so and you must not move.</p>\r\n', '2017-02-14 04:40:44', '2017-02-14 04:40:44');
