(1, 'Books', 'books', 0, '0.00', 0, '0.00', 1, 1, 0, 'The book description is your lead in, your chance to hook a reader and get them to crack the cover and satisfy their curiosity. Even in an online environment, the book description can bridge the gap between having just another title among a sea of choices and a sellable book worth reading.', 1790, '2017-02-14 04:24:11', '2017-02-14 04:24:11'),
(2, 'Novels', 'novels', 0, '0.00', 0, '0.00', 1, 1, 0, 'A novel is a long narrative, normally in prose, which describes fictional characters and events, usually in the form of a sequential story.', 1790, '2017-02-14 04:24:35', '2017-02-14 04:24:35'),
(3, 'Magazines', 'magazines', 0, '0.00', 0, '0.00', 1, 1, 0, 'A magazine is a publication, usually a periodical publication, which is printed or electronically published (sometimes referred to as an online magazine). Magazines are generally published on a regular schedule and contain a variety of content.', 1790, '2017-02-14 04:25:00', '2017-02-14 04:25:00'),
(4, 'News Papers', 'news-papers', 0, '0.00', 0, '0.00', 1, 1, 0, 'A newspaper is a serial publication containing news about current events, other informative articles (listed below) about politics, sports, arts, and so on, and advertising. A newspaper is usually, but not exclusively, printed on relatively inexpensive, low-grade paper such as newsprint.', 1790, '2017-02-14 04:25:35', '2017-02-14 04:27:54');
