(812, 96, 2845, '', '5116ad5cba9977ce4835ba733765b9cc43d45234', 'para', '<p>Read the below paragraph and answer&nbsp;</p>\r\n\r\n<p>I felt the wall of the tunnel shiver. The master alarm squealed through my earphones. Almost simultaneously, Jack yelled down to me that there was a warning light on. Fleeting but spectacular sights snapped into ans out of view, the snow, the shower of debris, the moon, looming close and big, the dazzling sunshine for once unfiltered by layers of air. The last twelve hours before re-entry were particular bone-chilling. During this period, I had to go up in to command module. Even after the fiery re-entry splashing down in 81o&nbsp;water in south pacific, we could still see our frosty breath inside the command module.</p>\r\n', '', 0, 3, '[{"question":"The master alarm squealed through my?","total_options":"4","options":[["Earphones","Headset","Watch","Reset"]]},{"question":"The last twelve hours before re-entry were particular?","total_options":"4","options":{"1":["Perticular","During this period","Bone-chilling","None"]}},{"question":"We could still see our frosty ?","total_options":"4","options":{"2":["Inside","Breath","None","Empty"]}}]', 3, '[{"answer":"1"},{"answer":"3"},{"answer":"2"}]', 20, 300, 'easy', 'No Hint', '<p>No Explanation</p>\r\n', NULL, 1, '2017-02-17 05:54:54', '2017-02-17 06:07:01'),
